import React from 'react';
import {connect} from 'react-redux';

class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {

    return (
        <div className="wrapper">
            <h1>These are the icons</h1>
            <div id="container">
                <Icon name="flower"/>
                <Icon name="heart"/>
                <Icon name="star"/>
        </div>
        </div>
    )
}

}
